import { useState } from 'react'
import React from 'react'

export default function Task() {
    const [ Tasks , setTask ]=useState({ 
        id :'1' ,
        text : 'studing js',
        reminder : 'true',
    },
    {
        id :'2' ,
        text : 'studing js',
        reminder : 'false',
    },
    {
        id :'3' ,
        text : 'studing js',
        reminder : 'true',
    })
  return (
    <div>
      {Tasks.map((task) =>(<h3 key={task.id}>{task.text}</h3>))} 
         </div>
  )
}
